import React from 'react';


class Explore extends React.Component{
  render(){
      return(
          <div>
              <h1>Welcom to Sympatheia!</h1>
              <h2>What is Sympathiea?</h2>
              <p>Sympatheia is an experimental website investigating text tone using sentiment analysis. On your homepage you will find a feed of each 
                  with a general sentiment rating. Each article recieves a rating of polarity and subjectivity. If an article is particularly opinionated it will recieve a higher subjectivity rating
                  and if an article is particularly optimistic it will recieve a high polarity rating and visa verse. 
              </p>
          </div>
      )
  }
}

export default Explore;
